import styled from "styled-components";

export const DivNavbar = styled.div`
  width: 100%;
  height: 56px;
  background: #002240;
  display: flex;
  align-items: center;

  .logo {
    width: 50%;
    margin: 0 auto;
    color: #ffffff;
    font-size: 20px;
  }
`;
